import React, {Component} from 'react';
import snake from '../snake';


class Games extends Component{
    state = {
        snakeDots: [ [0,0],[2,0]
    ]
    }
    render(){
        return(
            <div className="game-area">
                <h1>we are gaming</h1>
                <snake snakeDots={this/this.state.snakeDots}/>

            </div>
        );
    };
}

export default Games;
